import React from 'react'

const Paginas = (props) => {
  return (
    <div>
        <h2>{props.escenario}</h2>
        <h3>Url del video</h3>
        <h3>Tareas</h3>
        <textarea>Transcripcion</textarea>
    </div>
  )
}

export default Paginas;
